earthquake will probably be blamed on global warming, pelosi and obama
to ram through healthcare takeover, USA patriot act renewed again, Kucinich
knows healthcare is wealth transfer, News &amp; commentary

HOUR 2: Latest on climategate, Open Lines, Congress is suppose to oversee
issuance of money but can't have oversight of the federal reserve?, global
governance, origin of word &quot;child&quot; is of an untested Knight, Shooter Jennings
on AJS tomorrow &amp; Stephen King spoken word, King has known about NWO for long
time - The Stand, &quot;Child Roland To The Dark Tower Came&quot;, etc., read The Decline
and Fall of the Roman Empire by Edward Gibbon to understand the New World Order,
AJ also suggests reading None Dare Call It Conspiracy Allen &amp; Abraham, (other 
books may include Carrol Quigley's Tagedy &amp; Hope or Skousen's Naked Capitalist),
history on population census - to apportion political representation not to
answer federal government questionairres, learn fifth amendment, Stephen King 
world exclussive tomorrow, more Open Lines


88.7 FM Olympia, WA (west side)
